// header.js
import React, { Component } from "react";

const Header = (props) => {
  const [score, maxScore] = props;

  return (
    <div id="header">
      <div className="header-flex">
        <h2>Memory Match</h2>
      </div>
      <div className="header-flex">
        <h3>Score: {score} </h3>
        <h3>Best: {maxScore}</h3>
      </div>
    </div>
  );
}

export default Header;
